import React, { useState } from 'react';
import './MultiAIImageGenerator.css';

const MultiAIImageGenerator = () => {
  const [prompt, setPrompt] = useState('');
  const [imageType, setImageType] = useState('logo');
  const [enhancedPrompt, setEnhancedPrompt] = useState('');
  const [images, setImages] = useState([]);
  const [isEnhancing, setIsEnhancing] = useState(false);
  const [isGenerating, setIsGenerating] = useState(false);
  const [error, setError] = useState('');
  const [selectedImage, setSelectedImage] = useState(null);

  const examples = {
    logo: "ÿ¥ÿπÿßÿ± ÿπÿµÿ±Ÿä ŸÑŸÖÿ™ÿ¨ÿ± ŸÇŸáŸàÿ© ŸÖÿ™ÿÆÿµÿµ",
    character: "ÿ¥ÿÆÿµŸäÿ© ŸÉÿ±ÿ™ŸàŸÜŸäÿ© ŸÑÿ∑ŸÅŸÑ ŸäŸÑÿπÿ® ÿ®ÿßŸÑŸÉÿ±ÿ©",
    scene: "ÿ¥ÿßÿ∑ÿ¶ ÿßÿ≥ÿ™Ÿàÿßÿ¶Ÿä ŸÖÿπ ÿ£ÿ¥ÿ¨ÿßÿ± ŸÜÿÆŸäŸÑ ŸàŸÇÿ™ ÿßŸÑÿ∫ÿ±Ÿàÿ®",
    design: "ÿ™ÿµŸÖŸäŸÖ ŸáŸÜÿØÿ≥Ÿä ÿ•ÿ≥ŸÑÿßŸÖŸä ÿ®ÿ£ŸÑŸàÿßŸÜ ÿ∞Ÿáÿ®Ÿäÿ©"
  };

  const typeIcons = {
    logo: 'üéØ',
    character: 'üë§',
    scene: 'üåÜ',
    design: '‚ú®'
  };

  const typeLabels = {
    logo: 'ŸÑŸàÿ¨Ÿà',
    character: 'ÿ¥ÿÆÿµŸäÿ©',
    scene: 'ŸÖÿ¥ŸáÿØ',
    design: 'ÿ™ÿµŸÖŸäŸÖ'
  };

  // ÿ™ÿ≠ÿ≥ŸäŸÜ ÿßŸÑŸÜÿµ ÿ®Ÿàÿßÿ≥ÿ∑ÿ© Claude API
  const enhancePrompt = async () => {
    if (!prompt.trim()) {
      setError('ÿßŸÑÿ±ÿ¨ÿßÿ° ŸÉÿ™ÿßÿ®ÿ© ŸàÿµŸÅ ŸÑŸÑÿµŸàÿ±ÿ© ÿ£ŸàŸÑÿßŸã');
      return;
    }

    setIsEnhancing(true);
    setError('');

    try {
      const response = await fetch("https://api.anthropic.com/v1/messages", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          model: "claude-sonnet-4-20250514",
          max_tokens: 300,
          messages: [{
            role: "user",
            content: `You are an expert at writing image generation prompts. Convert this simple prompt into a detailed, professional English prompt optimized for AI image generation.

Image Type: ${imageType}
User Input: ${prompt}

Requirements:
- Keep it under 100 words
- Be specific about style, colors, lighting, composition
- Use professional art terminology
- Focus on visual details
- Output ONLY the enhanced prompt, no explanations or quotation marks

Enhanced Prompt:`
          }]
        })
      });

      const data = await response.json();
      const enhanced = data.content[0].text.trim();
      setEnhancedPrompt(enhanced);
      setIsEnhancing(false);
      
      // ÿ®ÿØÿ° ÿßŸÑÿ™ŸàŸÑŸäÿØ ÿ™ŸÑŸÇÿßÿ¶ŸäÿßŸã
      generateImages(enhanced);
    } catch (err) {
      setError('ŸÅÿ¥ŸÑ ÿ™ÿ≠ÿ≥ŸäŸÜ ÿßŸÑŸÜÿµ. ÿ≥ŸÜÿ≥ÿ™ÿÆÿØŸÖ ÿßŸÑŸÜÿµ ÿßŸÑÿ£ÿµŸÑŸä.');
      setIsEnhancing(false);
      generateImages(prompt);
    }
  };

  // ÿ™ŸàŸÑŸäÿØ ŸÖŸÜ 3 ŸÖÿµÿßÿØÿ± ŸÖÿÆÿ™ŸÑŸÅÿ©
  const generateImages = async (finalPrompt) => {
    setIsGenerating(true);
    setImages([]);
    setSelectedImage(null);

    const seed = Date.now();
    
    let typePrefix = '';
    switch (imageType) {
      case 'logo':
        typePrefix = 'professional logo design, ';
        break;
      case 'character':
        typePrefix = 'character illustration, ';
        break;
      case 'scene':
        typePrefix = 'photorealistic scene, ';
        break;
      case 'design':
        typePrefix = 'artistic design, ';
        break;
      default:
        typePrefix = '';
    }

    const fullPrompt = typePrefix + finalPrompt;

    const sources = [
      {
        name: 'Pollinations AI',
        description: 'ÿ≥ÿ±Ÿäÿπ ŸàŸÖÿ™Ÿàÿßÿ≤ŸÜ',
        url: `https://image.pollinations.ai/prompt/${encodeURIComponent(fullPrompt)}?width=512&height=512&seed=${seed}&enhance=true`,
        color: '#667eea'
      },
      {
        name: 'Pollinations V2',
        description: 'ŸÜÿ≥ÿÆÿ© ŸÖÿ≠ÿ≥ŸëŸÜÿ©',
        url: `https://image.pollinations.ai/prompt/${encodeURIComponent(fullPrompt + ', high quality, detailed')}?width=512&height=512&seed=${seed + 1}&model=flux`,
        color: '#764ba2'
      },
      {
        name: 'Pollinations Style',
        description: 'ÿ£ÿ≥ŸÑŸàÿ® ŸÅŸÜŸä',
        url: `https://image.pollinations.ai/prompt/${encodeURIComponent(fullPrompt + ', artistic style, vibrant colors')}?width=512&height=512&seed=${seed + 2}&nologo=true`,
        color: '#f093fb'
      }
    ];

    for (let i = 0; i < sources.length; i++) {
      await new Promise(resolve => setTimeout(resolve, 800));
      setImages(prev => [...prev, {
        ...sources[i],
        status: 'ready',
        id: i
      }]);
    }

    setIsGenerating(false);
  };

  const downloadImage = async (imageUrl, imageName) => {
    try {
      const response = await fetch(imageUrl);
      const blob = await response.blob();
      const url = window.URL.createObjectURL(blob);
      const link = document.createElement('a');
      link.href = url;
      link.download = `${imageName}-${Date.now()}.png`;
      document.body.appendChild(link);
      link.click();
      document.body.removeChild(link);
      window.URL.revokeObjectURL(url);
    } catch (err) {
      setError('ŸÅÿ¥ŸÑ ÿ™ÿ≠ŸÖŸäŸÑ ÿßŸÑÿµŸàÿ±ÿ©');
    }
  };

  const downloadSelected = () => {
    if (selectedImage) {
      downloadImage(selectedImage.url, selectedImage.name);
    }
  };

  return (
    <div className="multi-ai-container">
      <div className="multi-ai-wrapper">
        
        {/* Header */}
        <div className="multi-ai-header">
          <div className="header-content">
            <span className="header-icon">‚ú®</span>
            <h1>ŸÖŸàŸÑŸëÿØ ÿßŸÑÿµŸàÿ± ÿßŸÑŸÖÿ™ŸÇÿØŸÖ</h1>
          </div>
          <p className="header-subtitle">3 ŸÖÿ≠ÿ±ŸÉÿßÿ™ AI + ÿ™ÿ≠ÿ≥ŸäŸÜ ÿ∞ŸÉŸä = ŸÜÿ™ÿßÿ¶ÿ¨ ÿßÿ≠ÿ™ÿ±ÿßŸÅŸäÿ©</p>
        </div>

        <div className="multi-ai-content">
          
          {/* ŸÜŸàÿπ ÿßŸÑÿµŸàÿ±ÿ© */}
          <div className="section">
            <h3 className="section-title">ÿßÿÆÿ™ÿ± ŸÜŸàÿπ ÿßŸÑÿµŸàÿ±ÿ©:</h3>
            <div className="type-grid">
              {Object.keys(examples).map(type => (
                <button
                  key={type}
                  onClick={() => setImageType(type)}
                  className={`type-card ${imageType === type ? 'active' : ''}`}
                >
                  <span className="type-icon">{typeIcons[type]}</span>
                  <span className="type-label">{typeLabels[type]}</span>
                </button>
              ))}
            </div>
          </div>

          {/* ÿ≠ŸÇŸÑ ÿßŸÑÿ•ÿØÿÆÿßŸÑ */}
          <div className="section">
            <div className="input-header">
              <h3 className="section-title">ÿßŸÉÿ™ÿ® ŸàÿµŸÅ ÿßŸÑÿµŸàÿ±ÿ©:</h3>
              <button
                onClick={() => setPrompt(examples[imageType])}
                className="example-btn"
              >
                üí° ŸÖÿ´ÿßŸÑ
              </button>
            </div>
            <textarea
              value={prompt}
              onChange={(e) => setPrompt(e.target.value)}
              placeholder={`ŸÖÿ´ÿßŸÑ: ${examples[imageType]}`}
              className="prompt-textarea"
              rows="3"
            />
            <div className="char-counter">{prompt.length} / 500 ÿ≠ÿ±ŸÅ</div>
          </div>

          {/* ÿ≤ÿ± ÿßŸÑÿ™ŸàŸÑŸäÿØ */}
          <button
            onClick={enhancePrompt}
            disabled={isEnhancing || isGenerating || !prompt.trim()}
            className="generate-btn"
          >
            {isEnhancing ? (
              <>
                <span className="spinner"></span>
                ÿ¨ÿßÿ±Ÿä ÿ™ÿ≠ÿ≥ŸäŸÜ ÿßŸÑŸÜÿµ ÿ®ÿßŸÑÿ∞ŸÉÿßÿ° ÿßŸÑÿßÿµÿ∑ŸÜÿßÿπŸä...
              </>
            ) : isGenerating ? (
              <>
                <span className="spinner"></span>
                ÿ¨ÿßÿ±Ÿä ÿ™ŸàŸÑŸäÿØ 3 ŸÜÿ≥ÿÆ...
              </>
            ) : (
              <>
                <span className="wand-icon">ü™Ñ</span>
                ÿ™ÿ≠ÿ≥ŸäŸÜ + ÿ™ŸàŸÑŸäÿØ ŸÖŸÜ 3 ŸÖÿ≠ÿ±ŸÉÿßÿ™ AI
              </>
            )}
          </button>

          {/* ÿßŸÑŸÜÿµ ÿßŸÑŸÖÿ≠ÿ≥ŸëŸÜ */}
          {enhancedPrompt && (
            <div className="enhanced-box">
              <div className="enhanced-header">
                <span className="check-icon">‚úì</span>
                <h4>ÿßŸÑŸÜÿµ ÿßŸÑŸÖÿ≠ÿ≥ŸëŸÜ ÿ®ÿßŸÑŸÄ AI:</h4>
              </div>
              <p className="enhanced-text">{enhancedPrompt}</p>
            </div>
          )}

          {/* ÿ±ÿ≥ÿßŸÑÿ© ÿÆÿ∑ÿ£ */}
          {error && (
            <div className="error-box">
              <span className="error-icon">‚ö†Ô∏è</span>
              <p>{error}</p>
            </div>
          )}

          {/* ÿπÿ±ÿ∂ ÿßŸÑÿµŸàÿ± */}
          {images.length > 0 && (
            <div className="results-section">
              <h3 className="results-title">üé® ÿßŸÑŸÜÿ™ÿßÿ¶ÿ¨ ŸÖŸÜ 3 ŸÖÿ≠ÿ±ŸÉÿßÿ™ ŸÖÿÆÿ™ŸÑŸÅÿ©</h3>
              
              <div className="images-grid">
                {images.map((img) => (
                  <div
                    key={img.id}
                    className={`image-card ${selectedImage?.id === img.id ? 'selected' : ''}`}
                    onClick={() => setSelectedImage(img)}
                  >
                    <div 
                      className="color-bar"
                      style={{ backgroundColor: img.color }}
                    />
                    <div className="card-content">
                      <div className="card-header">
                        <div>
                          <h4 className="card-title">{img.name}</h4>
                          <p className="card-description">{img.description}</p>
                        </div>
                        {selectedImage?.id === img.id && (
                          <span className="selected-badge">‚úì</span>
                        )}
                      </div>
                      <div className="image-wrapper">
                        <img
                          src={img.url}
                          alt={img.name}
                          className="generated-img"
                          loading="lazy"
                        />
                      </div>
                      <button
                        onClick={(e) => {
                          e.stopPropagation();
                          downloadImage(img.url, img.name);
                        }}
                        className="download-btn-small"
                      >
                        ‚¨áÔ∏è ÿ™ÿ≠ŸÖŸäŸÑ
                      </button>
                    </div>
                  </div>
                ))}
              </div>

              {selectedImage && (
                <div className="selected-box">
                  <p className="selected-text">
                    <strong>ÿ™ŸÖ ÿßÿÆÿ™Ÿäÿßÿ±:</strong> {selectedImage.name}
                  </p>
                  <button
                    onClick={downloadSelected}
                    className="download-btn-large"
                  >
                    ‚¨áÔ∏è ÿ™ÿ≠ŸÖŸäŸÑ ÿßŸÑÿµŸàÿ±ÿ© ÿßŸÑŸÖÿÆÿ™ÿßÿ±ÿ©
                  </button>
                </div>
              )}

              <button
                onClick={() => generateImages(enhancedPrompt || prompt)}
                className="regenerate-btn"
              >
                üîÑ ÿ™ŸàŸÑŸäÿØ 3 ŸÜÿ≥ÿÆ ÿ¨ÿØŸäÿØÿ© ÿ®ŸÄ Seed ŸÖÿÆÿ™ŸÑŸÅ
              </button>
            </div>
          )}

          {/* ŸÖÿπŸÑŸàŸÖÿßÿ™ */}
          <div className="info-box">
            <h4 className="info-title">‚ú® ŸÉŸäŸÅ ŸäÿπŸÖŸÑ ÿßŸÑÿ™ÿ∑ÿ®ŸäŸÇ:</h4>
            <ul className="info-list">
              <li>ü§ñ <strong>ÿßŸÑŸÖÿ±ÿ≠ŸÑÿ© 1:</strong> Claude AI Ÿäÿ≠ÿ≥ŸëŸÜ ŸÜÿµŸÉ ŸàŸäÿ¨ÿπŸÑŸá ÿßÿ≠ÿ™ÿ±ÿßŸÅŸäÿßŸã</li>
              <li>üé® <strong>ÿßŸÑŸÖÿ±ÿ≠ŸÑÿ© 2:</strong> 3 ŸÖÿ≠ÿ±ŸÉÿßÿ™ ŸÖÿÆÿ™ŸÑŸÅÿ© ÿ™ŸàŸÑŸëÿØ ÿßŸÑÿµŸàÿ± ÿ®ŸÜŸÅÿ≥ ÿßŸÑŸàŸÇÿ™</li>
              <li>‚≠ê <strong>ÿßŸÑŸÖÿ±ÿ≠ŸÑÿ© 3:</strong> ÿ™ÿÆÿ™ÿßÿ± ÿßŸÑÿ£ŸÅÿ∂ŸÑ Ÿàÿ™ÿ≠ŸÖŸëŸÑŸá ŸÅŸàÿ±ÿßŸã!</li>
              <li>üîÑ <strong>ŸÖŸäÿ≤ÿ© ÿ•ÿ∂ÿßŸÅŸäÿ©:</strong> ŸäŸÖŸÉŸÜŸÉ ÿ™ŸàŸÑŸäÿØ ŸÜÿ≥ÿÆ ÿ¨ÿØŸäÿØÿ© ÿ®ÿ£ÿ±ŸÇÿßŸÖ seed ŸÖÿÆÿ™ŸÑŸÅÿ©</li>
            </ul>
          </div>

        </div>
      </div>
    </div>
  );
};

export default MultiAIImageGenerator;
